import React from 'react';
import './index.css';

function App() {
  return (
    <div style={{ backgroundColor: 'red', color: 'white', padding: '20px' }}>
      <h1 style={{ fontSize: '24px', fontWeight: 'bold' }}>Manual CSS Test</h1>
      <p>If this is red, React is working but Tailwind needs fix</p>
      
      {/* Tailwind test */}
      <div className="bg-blue-500 text-white p-4 mt-4">
        <h2 className="text-xl font-bold">Tailwind Test Box</h2>
        <p>If this is blue, Tailwind is working!</p>
      </div>
    </div>
  );
}

export default App;
